def bin_search(arr: List[int], i: int) -> int:
    start = 0
    finish = len(arr) - 1

    while start <= finish:
        center = (finish + start) // 2
        guess = arr[center]
        if guess == i:
            return center
        if guess > i:
            finish = center - 1
        else:
            start = center + 1
        # print(f'{guess}, {start}, {finish}, {center}')
    return -1


